import './Cards.css';
import Films from '../../swapiDataFetch';
import React from "react";

export default Card = () => {
    return (
        <div>
            {Films.map(title => (
                <div className="card">
                    <h1>{title}</h1>
                    <img src={lightsabersLit} className="lightsabersLit" />
                </div>
            ))}
        </div>
    )
}
